      {/* container */}

      <div className="max-w-[1000px] mx-auto px-8 flex flex-col justify-center h-full">
        <p> Hi, my name is </p>
        <h1> Aadhithya J</h1>
        <h2> I'm a Full Stack Developer</h2>
        <p>
          {" "}
